import {BrowserRouter as Router,Routes, Route} from 'react-router-dom';
import Header from './Header';
import Content from './Content';
import Footer from './Footer';
import News from './News';
import Products from './Products';

function App() {

  return (
    <div className="App">
      <Router>
        <Header />
        <Content />
        <News/>
        <Products/>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
